// src/components/Navbar.js
import React from 'react';
import NavLinks from './NavLinks';

const Navbar = () => {
  return (
    <nav style={{
      backgroundColor: '#282c34',
      width: '100%',
      padding: '0.75rem 2rem',
      display: 'flex',
      justifyContent: 'center'
    }}>
      <NavLinks />
    </nav>
  );
};

export default Navbar;
